import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField'
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
	suggestion: {

		cursor: 'pointer',
        borderLeft: '1px solid black',
        borderRight: '1px solid black',
        borderBottom: '1px solid black',
        borderTop: '1px solid black',
        background: 'white',
        '&:hover': {
            background: "gray",
        }
	},

    correct: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'baseline',
        fontSize: '24px',
        textAlign: 'center',
        marginBottom: theme.spacing(2),
        color: 'green',
        borderColor: 'green',
        borderLeft: '1px solid ',
        borderRight: '1px solid ',
        borderBottom: '1px solid ',
        borderTop: '1px solid ',
    },

    incorrect: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'baseline',
        fontSize: '24px',
        textAlign: 'center',
        marginBottom: theme.spacing(2),
        color: 'red',
        borderColor: 'red',
        borderLeft: '1px solid ',
        borderRight: '1px solid ',
        borderBottom: '1px solid ',
        borderTop: '1px solid ',
    }, 


}));

const Results = (props) => {

	const { history } = props;
    const { results } = props;
    const { answers } = props;
    console.log(results)
    console.log('ok', answers.answers[0].name)
    const classes = useStyles();
    console.log('history: ', history[0])

    return (
		<React.Fragment>                    
            <Container maxWidth="md" component="main" >
            {answers.answers.map((ans, index) => {   
                console.log('an', ans.name)
                console.log('din', history[index]) 
                return ans.name == history[index] ? ( 
                        <Card >
                            <CardContent className= {classes.result}>
                                        <li  className={classes.correct} key = {index}>{history[index]}</li> 
                            </CardContent>
                        </Card>
                            ) :(
                            <Card >
                                <CardContent className= {classes.result}>
                                <li  className={classes.incorrect} key = {index}>{history[index]}</li>
                                </CardContent>
                            </Card>

                        )

                         })}
                    </Container>
        </React.Fragment>
    );
};

export default Results
